import React, { useState, useEffect } from 'react';
import axios from 'axios';

// Expanded list to match the clues our scraper is now generating
const CLUE_LIST = ["shortest_path", "weighted", "contiguous", "sorted", "stack_in_out", "string_elimination"];
const TECH_LIST = ["BFS", "Dijkstra", "Sliding Window", "Two Pointers", "Stack", "DP"];

function App() {
    const [problems, setProblems] = useState([]);
    const [current, setCurrent] = useState(0);
    const [selectedClues, setSelectedClues] = useState([]);
    const [selectedTech, setSelectedTech] = useState("");
    const [result, setResult] = useState(null);

    const fetchData = () => {
        axios.get('http://127.0.0.1:8000/problems')
            .then(res => {
                setProblems(res.data);
                setResult(null); // Clear old results on refresh
            })
            .catch(err => console.error("Database connection failed. Is the backend running?"));
    };

    useEffect(() => {
        fetchData();
    }, []);

    const handleToggleClue = (clue) => {
        setSelectedClues(prev =>
            prev.includes(clue) ? prev.filter(c => c !== clue) : [...prev, clue]
        );
    };

    const handleVerify = async () => {
        try {
            const res = await axios.post('http://127.0.0.1:8000/validate', {
                id: problems[current].id,
                tech: selectedTech,
                clues: selectedClues
            });
            setResult(res.data);
        } catch (e) {
            alert("Validation Error: Ensure backend /validate endpoint is active.");
        }
    };

    const nextProblem = () => {
        setCurrent((prev) => (prev + 1) % problems.length);
        setSelectedClues([]);
        setSelectedTech("");
        setResult(null);
    };

    if (!problems.length) return (
        <div style={{ padding: '2rem', textAlign: 'center' }}>
            <h3>No problems found in trainer.db</h3>
            <button onClick={fetchData} style={{ padding: '10px' }}>Retry Connection</button>
            <p style={{ color: '#666' }}>Run <code>python scraper.py</code> to add data.</p>
        </div>
    );

    return (
        <div style={{ padding: '2rem', maxWidth: '900px', margin: 'auto', fontFamily: 'monospace', color: '#333' }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <h1>SYSTEM_TRAINER_V1</h1>
                <button onClick={nextProblem} style={{ padding: '5px 15px' }}>NEXT_PROBLEM »</button>
            </div>

            <div style={{ border: '2px solid #333', padding: '1.5rem', marginBottom: '1rem', maxHeight: '400px', overflowY: 'auto', background: '#fff' }}>
                <h2 style={{ marginTop: 0 }}>{problems[current].title}</h2>
                <hr />
                {/* whitespace: pre-wrap preserves the Markdown formatting from your scraper */}
                <div style={{ whiteSpace: 'pre-wrap', lineHeight: '1.6' }}>
                    {problems[current].description || "Problem content is still translating..."}
                </div>
            </div>

            <h4>1. Identify Structural Signals:</h4>
            <div style={{ display: 'flex', flexWrap: 'wrap', gap: '5px' }}>
                {CLUE_LIST.map(c => (
                    <button key={c} onClick={() => handleToggleClue(c)}
                        style={{
                            padding: '8px 12px',
                            cursor: 'pointer',
                            border: '1px solid #333',
                            background: selectedClues.includes(c) ? '#00ff00' : '#fff',
                            fontWeight: selectedClues.includes(c) ? 'bold' : 'normal'
                        }}>
                        {c.toUpperCase().replace('_', ' ')}
                    </button>
                ))}
            </div>

            <h4>2. Assign Algorithmic Mechanic:</h4>
            <select
                value={selectedTech}
                onChange={(e) => setSelectedTech(e.target.value)}
                style={{ width: '100%', padding: '12px', fontSize: '1rem', border: '2px solid #333' }}
            >
                <option value="">-- UNKNOWN --</option>
                {TECH_LIST.map(t => <option key={t} value={t}>{t}</option>)}
            </select>

            <button
                onClick={handleVerify}
                disabled={!selectedTech}
                style={{
                    marginTop: '20px',
                    padding: '15px 30px',
                    width: '100%',
                    background: '#333',
                    color: '#fff',
                    fontSize: '1.1rem',
                    cursor: 'pointer',
                    opacity: selectedTech ? 1 : 0.5
                }}
            >
                EXECUTE VALIDATION
            </button>

            {result && (
                <div style={{
                    marginTop: '20px',
                    padding: '20px',
                    border: '2px solid #333',
                    background: result.success ? '#d4edda' : '#f8d7da'
                }}>
                    <h3 style={{ marginTop: 0 }}>{result.success ? "✅ VALIDATION_SUCCESS" : "❌ VALIDATION_FAILED"}</h3>
                    <p>{result.success ? "Invariants match the problem structure." : "The signals identified do not support this mechanic."}</p>
                    <pre style={{ background: 'rgba(0,0,0,0.05)', padding: '10px' }}>
                        {JSON.stringify(result.feedback, null, 2)}
                    </pre>
                </div>
            )}
        </div>
    );
}

export default App;
